var title_f39_17_40209="Anteriorly displaced anus";
var content_f39_17_40209=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F65755&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F65755&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nineteen-year-old woman with life-long history of severe constipation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 328px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) In this 19 year-old woman with a life-long history of constipation, the&nbsp;anus is clearly anteriorly located,&nbsp;with a short perineal body. Normally, the anus should be located in the&nbsp;shiny pigmented skin, which is&nbsp;posterior to anal opening in this patient. B) Barium enema in the same patient. There is&nbsp;marked dilatation of rectum,&nbsp;extending to the anus. This is the typical appearance of so-called \"habit constipation\" or \"psychogenic\" constipation. However, some of these cases are probably caused by unrecognized slight anorectal malformation, as in this case.&nbsp;After anoplasty, this patient&nbsp;developed normal&nbsp;defecation patterns.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Hendren WH. Pediatric rectal and perineal problems. Pediatr Clin North Am 1998; 45:1353. Copyright &copy;1998 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
