var title_f39_17_40214="M mode obstructive HCM";
var content_f39_17_40214=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F70534&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F70534&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Hypertrophic obstructive cardiomyopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 356px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The M-mode echocardiogram&nbsp;is from a patient with a hypertrophic cardiomyopahty and resting obstruction. Panel A is from the minor axis of the left ventricle (LV) and demonstrates typical asymmetric ventricular hypertrophy of the interventricular septum (IVS). Systolic anterior motion (SAM) of the mitral valve (MV) and crowded appearance of ventricle are shown in panel B. The degree of contact between the septum and the mitral valve during systole appears minimal, suggesting that obstruction is mild. However, in panel C, the aortic valve (AoV) demonstrates striking mid- systolic notching or closure (arrow), strongly suggesting that dynamic obstruction is significant.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
